import { TabsContainer, HomePageContainer } from './styles'
import { useEffect, useState } from 'react'
import CampaingsTab from './Campaing'
import CampaingModel from '../../models/campaing'
import { User } from '../../models/user'
import { loadUserCampaings } from '../../services'
import SummaryCard from '../../components/CampaingElements/SummaryCard'

interface Props {
  user?: User []
}

const HomePage = ({ user }: Props) => {
  const [campaings, setCampaings] = useState<CampaingModel[]>()

  useEffect(() => {
    if(user) {
      loadUserCampaings(user[0].id, user[0].accessToken)
      .then(resp => {
        setCampaings(resp.data.campaings)
      })
      .catch(error => {
        console.log(error)
      })
    }
  }, [user])

  return (
    <HomePageContainer>
      <TabsContainer>

      </TabsContainer>

      {campaings? (
        campaings.map((campaing, index) => (
          <SummaryCard key={index} id={campaing.id} name={campaing.name} user={user} />
        ))
      ) : (
        'Nenhuma campanha foi criada até o momento.'
      )}
    </HomePageContainer>
  )
}

export default HomePage
